import React from "react";
import {Jumbotron, Container} from  "react-bootstrap";
// import Nav from "react-bootstrap/Nav";
// import axios from "axios";
import "./jumbotron.css";

const Jumbo = (props) => {
  return (
    <Jumbotron fluid>
  <Container>
    <h1>Welcome: Fluid Jumbotron</h1>
    <p>
     This will be my welcome statement. Maybe Later, I can add some admin functionality so that I can update what it says.
    </p>
  </Container>
</Jumbotron>
)
}

export default Jumbo;
